for(var x=0; x<runs.length; x++){

    console.log(runs[x])
    var coordinates = L.Polyline.fromEncoded(runs[x]).getLatLngs()
    console.log(coordinates)

    L.polyline(

        coordinates,
        {
            color:"blue",
            weight:5,
            opacity:.3,
            lineJoin:'round'
        }

    ).addTo(map)
};



